create database my_tcnapp;
use my_tcnapp;

CREATE TABLE `agenzia` (
  `P_IVA` varchar(11) NOT NULL,
  `RAGIONE_SOCIALE` varchar(80) DEFAULT NULL,
  `TELEFONO` varchar(10) DEFAULT NULL,
  `INDIRIZZO` varchar(60) DEFAULT NULL,
  `EMAIL` varchar(30) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



CREATE TABLE `rilievo` (
  `LONGITUDINE` varchar(35) NOT NULL,
  `LATITUDINE` varchar(35) NOT NULL,
  `CODISTAT` varchar(20) NOT NULL,
  `NOMECOMUNE` varchar(20) NOT NULL,
  `DUG` varchar(20) NOT NULL,
  `DENOMINAZIONE` varchar(20) NOT NULL,
  `CIVICO` int(10) NOT NULL,
  `ESPONENTE` varchar(20) DEFAULT 'NON DISPONIBILE',
  `PATHFOTOCIVICO` varchar(50) DEFAULT NULL,
  `PATHFOTOABITAZIONE` varchar(50) DEFAULT NULL,
  `DATA` varchar(10) DEFAULT NULL,
  `STATO` varchar(20) DEFAULT NULL,
  `CF_USER` varchar(20) DEFAULT NULL,
  `CF_SUPERUSER` varchar(20) DEFAULT NULL,
  `LONGITUDINE_ARR` varchar(35) DEFAULT NULL,
  `LATITUDINE_ARR` varchar(35) DEFAULT NULL,
  `ANNO_DI_COSTRUZIONE` int(11) DEFAULT NULL,
  `CLASSE_ENERGETICA` varchar(10) DEFAULT NULL,
  `DESCRIZIONE` varchar(100) DEFAULT NULL,
  `GIARDINO` tinyint(1) NOT NULL DEFAULT '0',
  `METRI_QUADRATI` varchar(6) NOT NULL,
  `N_BAGNI` int(11) NOT NULL DEFAULT '0',
  `N_LIVELLI` int(11) NOT NULL DEFAULT '0',
  `N_VANI` int(11) NOT NULL DEFAULT '0',
  `PIANO` varchar(20) DEFAULT NULL,
  `POSTO_AUTO` tinyint(1) NOT NULL DEFAULT '0',
  `PREZZO` double NOT NULL DEFAULT '0',
  `TIPOLOGIA` varchar(30) DEFAULT NULL,
  `ARREDAMENTO` tinyint(1) NOT NULL DEFAULT '1',
  `PROPRIETARIO` varchar(20) NOT NULL,
  `VENDITORE` varchar(20) NOT NULL,
  `ACQUIRENTE` varchar(20) DEFAULT NULL,
  `LOCATORE` varchar(20) DEFAULT NULL,
  `LOCATARIO` varchar(20) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;



CREATE TABLE `super_user` (
  `EMAIL` varchar(25) NOT NULL,
  `FULLNAME` varchar(25) NOT NULL,
  `PHONE` varchar(13) NOT NULL,
  `PASSWORD` varchar(50) NOT NULL,
  `CF` varchar(20) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;




CREATE TABLE `user` (
  `EMAIL` varchar(25) NOT NULL,
  `FULLNAME` varchar(25) NOT NULL,
  `PHONE` varchar(13) NOT NULL,
  `PASSWORD` varchar(50) NOT NULL,
  `CF` varchar(20) NOT NULL,
  `TYPE` varchar(20) NOT NULL,
  `INDIRIZZO` varchar(30) NOT NULL,
  `NOME` varchar(35) NOT NULL,
  `COGNOME` varchar(35) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;



ALTER TABLE `agenzia`
  ADD PRIMARY KEY (`P_IVA`);

ALTER TABLE `rilievo`
  ADD PRIMARY KEY (`LONGITUDINE`,`LATITUDINE`) USING BTREE,
  ADD KEY `CF_SUPERUSER` (`CF_SUPERUSER`),
  ADD KEY `CF_USER` (`CF_USER`);

ALTER TABLE `super_user`
  ADD PRIMARY KEY (`CF`);

ALTER TABLE `user`
  ADD PRIMARY KEY (`CF`);
COMMIT;
